0442-\u041f\u043e\u0439\u043d\u0442\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1831_%D0%B3%D0%BE%D0%B4\" title=\"1831 \u0433\u043e\u0434\">1831<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0440\u043e\u043c\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%8E%D0%B3%D0%BE,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80\" title=\"\u0413\u044e\u0433\u043e, \u0412\u0438\u043a\u0442\u043e\u0440\">\u0412\u0438\u043a\u0442\u043e\u0440\u0430 \u0413\u044e\u0433\u043e<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%9F%D0%B0%D1%80%D0%B8%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%91%D0%BE%D0%B3%D0%BE%D0%BC%D0%B0%D1%82%D0%B5%D1%80%D0%B8_(%D1%80%D0%BE%D0%BC%D0%B0%D0%BD)\" title=\"\u0421\u043e\u0431\u043e\u0440 \u041f\u0430\u0440\u0438\u0436\u0441\u043a\u043e\u0439 \u0411\u043e\u0433\u043e\u043c\u0430\u0442\u0435\u0440\u0438 (\u0440\u043e\u043c\u0430\u043d)\">\u0421\u043e\u0431\u043e\u0440 \u041f\u0430\u0440\u0438\u0436\u0441\u043a\u043e\u0439 \u0411\u043e\u0433\u043e\u043c\u0430\u0442\u0435\u0440\u0438<\/a>\u00bb .<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#160;\u2014 \u0438\u0437-\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%80%D0%B0%D0%BA%D0%B0\" title=\"\u0414\u0440\u0430\u043a\u0430\">\u0434\u0440\u0430\u043a\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u0443\u0441\u0442\u0440\u043e\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u0438\u0439<\/a>, \u043f\u043e\u043b\u0438\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0430<\/a> \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0442 \u043a\u043b\u0443\u0431 \u0430\u0440\u0442\u0438\u0441\u0442\u043e\u0432 \u0438 \u043f\u043e\u044d\u0442\u043e\u0432 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%B4%D1%8F%D1%87%D0%B0%D1%8F_%D1%81%D0%BE%D0%B1%D0%B0%D0%BA%D0%B0_(%D0%BA%D0%B0%D1%84%D0%B5)\" title=\"\u0411\u0440\u043e\u0434\u044f\u0447\u0430\u044f \u0441\u043e\u0431\u0430\u043a\u0430 (\u043a\u0430\u0444\u0435)\">\u0411\u0440\u043e\u0434\u044f\u0447\u0430\u044f \u0441\u043e\u0431\u0430\u043a\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0435\u0432\u0440\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0424\u0435\u0432\u0440\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f<\/a>. \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u043a\u043d\u044f\u0437\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%81%D1%8B%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_III)\" title=\"\u041c\u0438\u0445\u0430\u0438\u043b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 (\u0441\u044b\u043d \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 III)\">\u041c\u0438\u0445\u0430\u0438\u043b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447<\/a>, \u0431\u0440\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%80%D0%B5%D1%87%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB%D0%B0_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87%D0%B0\" title=\"\u041e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u0435 \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\u0430\">\u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442<\/a>, \u0447\u0442\u043e \u0437\u0430\u0439\u043c\u0451\u0442 \u0442\u0440\u043e\u043d \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%87%D1%80%D0%B5%D0%B4%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0423\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435\">\u0423\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u044f<\/a>.<\/li><li>\u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Maybelline\" title=\"Maybelline\">Maybelline<\/a>\u00bb \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u0442\u0443\u0448\u044c \u0434\u043b\u044f \u0440\u0435\u0441\u043d\u0438\u0446, \u00ab\u043f\u0435\u0440\u0432\u0443\u044e \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0443\u044e \u043a\u043e\u0441\u043c\u0435\u0442\u0438\u043a\u0443 \u0434\u043b\u044f \u0433\u043b\u0430\u0437 \u043d\u0430 \u043a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;the first modern eye cosmetic for everyday use).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a><ul><li>\u0417\u0430\u043a\u0440\u044b\u0442\u0438\u0435 X \u0441\u044a\u0435\u0437\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0420\u041a\u041f(\u0431)<\/a>; \u043d\u0430\u0447\u0430\u043b\u043e \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0430 \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D1%8D%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u041d\u043e\u0432\u0430\u044f \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0430\">\u041d\u042d\u041f\u0443<\/a>.<\/li><li>\u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1921)\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1921)\">\u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u0434\u0440\u0443\u0436\u0431\u0435 \u0438 \u0431\u0440\u0430\u0442\u0441\u0442\u0432\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0420\u0421\u0424\u0421\u0420<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0430\u0435\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0442\u043e\u0440\u0433\u043e\u0432\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a> \u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_%D0%A4%D0%B8%D1%83%D0%BC%D0%B5\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u043d\u044b\u0439 \u0433\u043e\u0440\u043e\u0434 \u0424\u0438\u0443\u043c\u0435\">\u0421\u0432\u043e\u0431\u043e\u0434\u043d\u044b\u0439 \u0433\u043e\u0440\u043e\u0434 \u0424\u0438\u0443\u043c\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%B4%D0%B4%D0%B0%D1%80%D0%B4,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u0413\u043e\u0434\u0434\u0430\u0440\u0434, \u0420\u043e\u0431\u0435\u0440\u0442\">\u0420\u043e\u0431\u0435\u0440\u0442 \u0413\u043e\u0434\u0434\u0430\u0440\u0434<\/a> \u043f\u0440\u043e\u0432\u0451\u043b \u0443\u0441\u043f\u0435\u0448\u043d\u043e\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u0435 \u043f\u0435\u0440\u0432\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BA%D0%B5%D1%82%D0%B0\" title=\"\u0420\u0430\u043a\u0435\u0442\u0430\">\u0440\u0430\u043a\u0435\u0442\u044b<\/a> \u043d\u0430 \u0436\u0438\u0434\u043a\u043e\u043c \u0442\u043e\u043f\u043b\u0438\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u041e\u043f\u0442\u0438\u043a\u043e-\u043c\u0435\u0445\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0440\u0435\u0441\u0442 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u0421\u043e\u044e\u0437\u0435 \u043f\u0440\u0438\u0441\u0442\u0443\u043f\u0438\u043b \u043a \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u043c\u0443 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0443 \u043b\u0438\u043d\u0437 \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%87%D0%BA%D0%B8\" title=\"\u041e\u0447\u043a\u0438\">\u043e\u0447\u043a\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u043d\u0430\u0446\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%BC%D0%B0%D1%85%D1%82\" title=\"\u0412\u0435\u0440\u043c\u0430\u0445\u0442\">\u0432\u0435\u0440\u043c\u0430\u0445\u0442<\/a> \u0438 \u0432\u0432\u0435\u0434\u0435\u043d\u0430 \u0432\u0441\u0435\u043e\u0431\u0449\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D1%8F%D0%B7%D0%B0%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u0412\u043e\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u044c\">\u0432\u043e\u0438\u043d\u0441\u043a\u0430\u044f \u043f\u043e\u0432\u0438\u043d\u043d\u043e\u0441\u0442\u044c<\/a>, \u0447\u0442\u043e \u044f\u0432\u0438\u043b\u043e\u0441\u044c \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u043c \u0441\u0435\u0440\u044c\u0451\u0437\u043d\u044b\u043c \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u0435\u043c \u0443\u0441\u043b\u043e\u0432\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%81%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4\" title=\"1936 \u0433\u043e\u0434\">1936<\/a>&#160;\u2014 \u0441 \u043a\u043e\u043d\u0432\u0435\u0439\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434\">\u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u043e\u0434\u0430<\/a> \u0441\u043e\u0448\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u043b\u0435\u0433\u043a\u043e\u0432\u0430\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0448\u0438\u043d\u0430&#160;\u2014 \u043b\u0438\u043c\u0443\u0437\u0438\u043d \u043c\u0430\u0440\u043a\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%90%D0%97-%D0%9C-1\" class=\"mw-redirect\" title=\"\u0413\u0410\u0417-\u041c-1\">\u041c-1<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0414\u0435\u043d\u044c \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u043f\u043e\u0434\u0440\u0430\u0437\u0434\u0435\u043b\u0435\u043d\u0438\u0439 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u041c\u0412\u0414 \u0420\u043e\u0441\u0441\u0438\u0438 (\u0421\u041b\u0423 \u041c\u0412\u0414 \u0420\u0424 \u043d\u0430 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D1%8B%D1%88%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B1%D1%80%D0%BE%D0%B2%D0%BE%D0%BB%D1%8C%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD_%D0%A1%D0%A1\" title=\"\u041b\u0430\u0442\u044b\u0448\u0441\u043a\u0438\u0439 \u0434\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u0447\u0435\u0441\u043a\u0438\u0439 \u043b\u0435\u0433\u0438\u043e\u043d \u0421\u0421\">\u043b\u0430\u0442\u0432\u0438\u0439\u0441\u043a\u0438\u0435 \u0447\u0430\u0441\u0442\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D0%A1%D0%A1\" title=\"\u0412\u043e\u0439\u0441\u043a\u0430 \u0421\u0421\">\u0432\u043e\u0439\u0441\u043a \u0421\u0421<\/a> (15-\u044f \u0438 19-\u044f \u0434\u0438\u0432\u0438\u0437\u0438\u0438) \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0437 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438 \u0432 \u0431\u043e\u0435\u0432\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0445 \u043f\u0440\u043e\u0442\u0438\u0432 \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u044e\u0449\u0438\u0445 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0435 \u0432\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0435 \u0412\u0412\u0421<\/a> \u043d\u0430 90&#160;% \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u043b\u0438 \u0433\u043e\u0440\u043e\u0434 \u00ab\u0441\u0442\u0430 \u0446\u0435\u0440\u043a\u0432\u0435\u0439\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8E%D1%80%D1%86%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0412\u044e\u0440\u0446\u0431\u0443\u0440\u0433\">\u0412\u044e\u0440\u0446\u0431\u0443\u0440\u0433<\/a> (\u0431\u043e\u043b\u044c\u0448\u0435, \u0447\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4%D0%B8%D1%80%D0%BE%D0%B2%D0%BA%D0%B0_%D0%94%D1%80%D0%B5%D0%B7%D0%B4%D0%B5%D0%BD%D0%B0\" title=\"\u0411\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043a\u0430 \u0414\u0440\u0435\u0437\u0434\u0435\u043d\u0430\">\u0414\u0440\u0435\u0437\u0434\u0435\u043d<\/a>), 5 \u0442\u044b\u0441. \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445 \u0437\u0430 18 \u043c\u0438\u043d.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B0%D1%81%D1%82%D1%83%D0%BF%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0441\u043a\u0430\u044f \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0412\u0435\u043d\u0441\u043a\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438<\/a> \u0432\u043e\u0439\u0441\u043a 3-\u0433\u043e \u0438 2-\u0433\u043e \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u043e\u0432.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-104_%D0%B2_%D0%A1%D0%B2%D0%B5%D1%80%D0%B4%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-104 \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-104 \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u0435<\/a>. \u0418\u0437-\u0437\u0430 \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0438 \u043e\u0431\u043e\u0438\u0445 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u0435\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u043f\u0440\u0438\u0437\u0435\u043c\u043b\u0438\u043b\u0441\u044f \u043d\u0430 \u0437\u0430\u043c\u0451\u0440\u0437\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B6%D0%BD%D0%B5-%D0%98%D1%81%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D1%83%D0%B4\" title=\"\u041d\u0438\u0436\u043d\u0435-\u0418\u0441\u0435\u0442\u0441\u043a\u0438\u0439 \u043f\u0440\u0443\u0434\">\u041d\u0438\u0436\u043d\u0435-\u0418\u0441\u0435\u0442\u0441\u043a\u0438\u0439 \u043f\u0440\u0443\u0434<\/a> \u0438 \u0432\u0440\u0435\u0437\u0430\u043b\u0441\u044f \u0432 \u0434\u043e\u043c \u043e\u0442\u0434\u044b\u0445\u0430. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 7 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a><ul><li>\u041f\u043e\u0441\u0440\u0435\u0434\u0438 \u0422\u0438\u0445\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D1%87%D0%B5%D0%B7%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D0%B5_L-1049_%D0%BD%D0%B0%D0%B4_%D0%A2%D0%B8%D1%85%D0%B8%D0%BC_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D0%BE%D0%BC\" title=\"\u0418\u0441\u0447\u0435\u0437\u043d\u043e\u0432\u0435\u043d\u0438\u0435 L-1049 \u043d\u0430\u0434 \u0422\u0438\u0445\u0438\u043c \u043e\u043a\u0435\u0430\u043d\u043e\u043c\">\u0438\u0441\u0447\u0435\u0437 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 Lockheed Super Constellation<\/a> \u0441\u043e 107 \u043b\u044e\u0434\u044c\u043c\u0438 \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 (96 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u0438 11 \u0447\u043b\u0435\u043d\u043e\u0432 \u044d\u043a\u0438\u043f\u0430\u0436\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D1%83%D1%89%D1%91%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%B8%D1%82%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0425\u0440\u0443\u0449\u0451\u0432, \u041d\u0438\u043a\u0438\u0442\u0430 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041d\u0438\u043a\u0438\u0442\u0430 \u0425\u0440\u0443\u0449\u0451\u0432<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0421\u0421\u0421\u0420 \u043e\u0431\u043b\u0430\u0434\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%BA%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B1%D0%B0%D0%BB%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0\" title=\"\u041c\u0435\u0436\u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0430\u044f \u0431\u0430\u043b\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u0430\u043a\u0435\u0442\u0430\">\u043c\u0435\u0436\u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0440\u0430\u043a\u0435\u0442\u043e\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963_%D0%B3%D0%BE%D0%B4\" title=\"1963 \u0433\u043e\u0434\">1963<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D0%B2%D0%B5%D1%80%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD%D0%B0\" title=\"\u0418\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0432\u0443\u043b\u043a\u0430\u043d\u0430\">\u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0432\u0443\u043b\u043a\u0430\u043d\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D0%B8\" title=\"\u0411\u0430\u043b\u0438\">\u0411\u0430\u043b\u0438<\/a>, \u043d\u0435 \u043c\u0435\u043d\u0435\u0435 1700 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2%D0%BE_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC%D0%B5\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0432\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0435\">\u0432\u043e\u0439\u043d\u044b \u0432\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0435<\/a> \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u043b\u0438 \u044e\u0436\u043d\u043e\u0432\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u0443\u044e \u0434\u0435\u0440\u0435\u0432\u043d\u044e \u041c\u0438\u043b\u0430\u0438 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B5_%D1%83%D0%B1%D0%B8%D0%B9%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%A1%D0%BE%D0%BD%D0%B3%D0%BC%D0%B8\" title=\"\u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0432 \u0421\u043e\u043d\u0433\u043c\u0438\">\u0421\u043e\u043d\u0433\u043c\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-9_%D0%B2_%D0%9C%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D0%B9%D0%B1%D0%BE\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-9 \u0432 \u041c\u0430\u0440\u0430\u043a\u0430\u0439\u0431\u043e\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-9 \u0432 \u041c\u0430\u0440\u0430\u043a\u0430\u0439\u0431\u043e<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 \u043f\u0440\u0438 \u0432\u0437\u043b\u0451\u0442\u0435 \u0440\u0443\u0445\u043d\u0443\u043b \u043d\u0430 \u0433\u043e\u0440\u043e\u0434, \u043f\u0440\u0438 \u044d\u0442\u043e\u043c \u043f\u043e\u0433\u0438\u0431\u043b\u0438 155 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a>&#160;\u2014 \u042f\u043c\u0430\u0439\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f. \u0411\u044b\u043b\u043e \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D1%82%D1%82%D0%BE%D0%BD-%D0%92%D1%83%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0\" title=\"\u0411\u0440\u0435\u0442\u0442\u043e\u043d-\u0412\u0443\u0434\u0441\u043a\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430\">\u043d\u043e\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u0430\u043b\u044e\u0442\u043d\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-134_%D0%B2_%D0%93%D0%B0%D0%B1%D0%B0%D1%80%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u0432 \u0413\u0430\u0431\u0430\u0440\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u0432 \u0413\u0430\u0431\u0430\u0440\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f<\/a>). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 73 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD%D0%BE-%D0%B8%D1%80%D0%B0%D0%BA%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0418\u0440\u0430\u043d\u043e-\u0438\u0440\u0430\u043a\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0438\u0440\u0430\u043d\u043e-\u0438\u0440\u0430\u043a\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%98%D1%80%D0%B0%D0%BA%D0%B0\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0418\u0440\u0430\u043a\u0430\">\u0412\u0412\u0421 \u0418\u0440\u0430\u043a\u0430<\/a> \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B7%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B0%D1%82%D0%B0%D0%BA%D0%B0_%D0%B2_%D0%A5%D0%B0%D0%BB%D0%B0%D0%B1%D0%B4%D0%B6%D0%B5\" title=\"\u0413\u0430\u0437\u043e\u0432\u0430\u044f \u0430\u0442\u0430\u043a\u0430 \u0432 \u0425\u0430\u043b\u0430\u0431\u0434\u0436\u0435\">\u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0430\u0442\u0430\u043a\u0443 \u043d\u0430 \u0433\u043e\u0440\u043e\u0434 \u0425\u0430\u043b\u0430\u0431\u0434\u0436\u0430<\/a>, \u0436\u0435\u0440\u0442\u0432\u0430\u043c\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0441\u0442\u0430\u043b\u0438 \u0442\u044b\u0441\u044f\u0447\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%B4%D1%8B\" title=\"\u041a\u0443\u0440\u0434\u044b\">\u043a\u0443\u0440\u0434\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0410\u0440\u043c\u0435\u043d\u0438\u044f\">\u0410\u0440\u043c\u0435\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0442 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0438 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0432 \u0410\u0440\u043c\u0435\u043d\u0438\u0438.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%85%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\">\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u0435<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B7%D1%80%D1%8B%D0%B2_%D0%B6%D0%B8%D0%BB%D0%BE%D0%B3%D0%BE_%D0%B4%D0%BE%D0%BC%D0%B0_%D0%B2_%D0%90%D1%80%D1%85%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B5_(2004)\" title=\"\u0412\u0437\u0440\u044b\u0432 \u0436\u0438\u043b\u043e\u0433\u043e \u0434\u043e\u043c\u0430 \u0432 \u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u0435 (2004)\">\u0432\u0437\u0440\u044b\u0432 \u0436\u0438\u043b\u043e\u0433\u043e \u0434\u043e\u043c\u0430<\/a>, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\